const api = async() => {
  // const options = {
  //   method: 'GET',
  //   headers: {
  //     'X-RapidAPI-Host': 'utelly-tv-shows-and-movies-availability-v1.p.rapidapi.com',
  //     'X-RapidAPI-Key': '8a6a8103d3msh638c25aa676be86p1d23fdjsnaa044a3e5946'
  //   }
  // };
  const url = 'https://api.themoviedb.org/3/';

  const data = await fetch(`${url}movie/550?api_key=3e9594956f7bdfe6a28130cd66f6d581`)
    .then(response => response.json())
    .then(response => console.log(response))
    .catch(err => console.error(err));

    return data;
}

export default api;
